import React from 'react';
import { useState } from 'react';
import Result from './Result';



function App(props) {
    const [state,newstate] =useState();
   
    const changes = (e)=>{
        newstate(e.target.value);
    }
    return (
        <div className='seachbar'>
            <input type="text"
            placeholder='Search anything' 
            value = {state}
            onChange = {changes}
            />
            <Result name = {state}/>
        </div>
    );
}

export default App;
